const canvas = (props) => {
  let style = {
    backgroundColor: `${props.color}`,
    position:"absolute",
    //top: props.top,
    //left:props.left,

    width: '100px',
    length: '100px'
  };
  console.log(style)
  return <div style={style}></div>
  //return <div></div>
}

export default canvas;
